  [],\n\t\"revision_timestamp\": \"2016-02-22T20:31:39.020057\",\n\t\"name\": \"nefsc-small-pelagics-acoustic-midwater-trawl-survey-de9903\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The small pelagics cruise will map the
  distribution of small pelagic species such as Atlantic mackerel, Atlantic herring,
  silver hake, butterfish, and squid, in the mid-Atlantic and Gulf of Maine regions
  of the northeast US. Acoustic data are the primary data and midwater trawl sites
  are selected on an ad hoc basis to sample acoustic backscatter attributed to small
  pelagic species. The primary gear is multifrequency Simrad echosounders, but midwater
  trawl, CTD, and a host of other scientific sensor data are collected ancillary to
  the acoustic data.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
